import React, {useState,useEffect} from "react"
import { useHistory } from "react-router-dom"
import '../css/home.css';

const Home = (props) =>{
    const history = useHistory();

    //#region check authentication
    if(typeof props.accountInfo === 'object' && props.accountInfo !== null)
        history.push("/main")
    
    if(props.accountInfo === false)
        return(<div></div>);
    //#endregion

    return(
        <div>this is Home</div>
    ) 

}

export default Home;
